using System;
using System.Collections.Generic;
using System.Linq;

struct NResult {
    public int n;
    public string l;
    public bool b;
    public override string ToString() => $"{{\"n\": {n}, \"l\": \"{l}\", \"b\": {b}}}";
}
class Program {
    static int[] nums = new int[]{1, 2};
    static string[] letters = new string[]{"A", "B"};
    static bool[] bools = new bool[]{true, false};
    static NResult[] combos = (from n in nums from l in letters from b in bools select new NResult{n = n, l = l, b = b}).ToArray();
    static void Main() {
        Console.WriteLine("--- Cross Join of three lists ---");
        foreach (var c in combos) {
    Console.WriteLine(string.Join(" ", new object[]{c.n, c.l, (c.b ? "true" : "false")}).TrimEnd());
}
    }
}
